import {
	add_post_action_creator,
	update_new_post_action_creator
} from "../../../../../redux/profile_reducer";
import CreatePostButton
	from "../../../Dialogs/CreatePostButton/CreatePostButton";
import React from "react";

const CreatePostButtonContainer = (props) => {
	let add_post = () => {
		let action = add_post_action_creator()
		props.dispatch(action)
	}

	let update_post = (post_title, post_content) => {
		let action = update_new_post_action_creator(post_title, post_content)
		props.dispatch(action)
	}

	return <CreatePostButton update_post={ update_post } add_post={ add_post }/>
}

export default CreatePostButtonContainer;
